import { connect } from "react-redux";
import MovieCard from "./MovieCard";
import Spinner from "../layout/Spinner";

export class MoviesContainer extends Component {
  render() {
    const { movies } = this.props;

    let content = "";
    let aray = [];
    aray = [movies.Search];

    var userDetail = [
      { name: "sunil", age: "24", place: "delhi", country: "India" },
      { name: "sujan", age: "22", place: "assam,", country: "India" },
      { name: "abishek", age: "26", place: "kolkata", country: "India" },
      { name: "chiranjeev", age: "20", place: "bangalore", country: "India" },
    ];
    let data = userDetail.map((user) => {
      console.log(user.name, user.age, user.place, user.country);
      return (
        <div className="row">
          <h1>{user.name}</h1>
          <h1>{user.age}</h1>
          <h1>{user.place}</h1>
          <h1>{user.country}</h1>
        </div>
      );
    });
    // content =
    //   movies.length > 0 ? (
    //     movies.map((movie, index) => <MovieCard key={index} movie={movie} />)
    //   ) : (
    //     <Spinner />
    //   );

    return (
      <div>
        <div>
          <p>Total result is {movies.totalResults}</p>
          <p>array of result is </p>
          <div></div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  movies: state.movies.movies,
});

export default connect(mapStateToProps)(MoviesContainer);
